  effective attenuation lengths (EALs) in solid elements and compounds at selected
  electron energies between 50 eV and 2,000 eV. The database was designed mainly to
  provide EALs (to account for effects of elastic-electron scattering) for applications
  in surface analysis by Auger-electron spectroscopy (AES) and X-ray photoelectron
  spectroscopy (XPS).\",\n\t\"owner_org\": \"9cda5205-d632-4814-96e7-a4ab5e0dce85\",\n\t\"extras\":
